import {
  mechanicalPropertiesData,
  operationalPropertiesData,
  waterOriginData,
  operationCostsData,
  enironmentalData,
  waterAnalysisData,
  customersProblemsAndRequestsData,
  thermodynamicCalculationsData
} from 'src/components/data'
const defaultValues = {};

[
  ...mechanicalPropertiesData,
  ...operationalPropertiesData,
  ...waterOriginData,
  ...operationCostsData,
  ...enironmentalData,
  ...waterAnalysisData,
  ...customersProblemsAndRequestsData,
  ...thermodynamicCalculationsData,
].forEach(item => {
  defaultValues[location] = item.defaultValue
})
const initialState = {
  windowSize: {},
  tablesData: {
    data: defaultValues,
    loading: false,
    error: null
  },
};
export default initialState;
